function toGraphviz(diagramType) {
  var schemas = this.require('factory').system().schemas();
  var models = this.require('factory').system().models();
  var types = this.require('factory').system().types();
  var components = this.require('factory').system().components();
  var inheritance = '';
  var modelId = '';
  var typeId = '';
  var componentId = '';
  var modelName = '';
  var typeName = '';
  var modelDescription = '';
  var propName = '';
  var propVal = '';
  var propDef = '';
  var attributes = '';
  var methods = '';
  var result = '';
  var dependencies = '';
  var instancesOf = '';
  var links = '';
  var collections = '';
  var instances = '';
  var that = this;
  var keys = [];
  var sortedKeys = {};
  var generatedDiagram = '';
  var parents = '';
  var modelNames = [];
  var modelDef = {};
  var incoming = '';
  var outgoing = '';
  var edges = '';

  callbackProp = function (param) {
    var realType = param.type;
    var isArray = false;

    if (Array.isArray(param.type)) {
      isArray = true;
      realType = param.type[0];
    }

    if (that.require('factory').isModel(realType) && realType !== '_Component') {
      if (isArray) {
        params = params + param.name + ' : [' + realType + '], ';
      } else {
        params = params + param.name + ' : ' + realType + ', ';
      }
    } else {
      if (['any', 'boolean', 'string', 'number', 'object', 'function', 'array', 'html', 'javascript', 'css', 'errorParam', 'json', 'text', 'date'].indexOf(realType) === -1 && realType !== '_Component') {
        if (isArray) {
          params = params + param.name + ' : [' + realType + '], ';
        } else {
          params = params + param.name + ' : ' + realType + ', ';
        }
      } else {
        if (isArray) {
          params = params + param.name + ' : [' + realType + '], ';
        } else {
          params = params + param.name + ' : ' + realType + ', ';
        }
      }
    }
  };

  function _getReturnType(returnType) {
    var result = '';
    var realType = returnType;
    var isArray = false;

    if (Array.isArray(returnType)) {
      isArray = true;
      realType = returnType[0];
    }

    if (that.require('factory').isModel(realType) && realType !== '_Component' && realType !== '_ClassInfo') {
      if (isArray) {
        result = '[' + realType + ']';
      } else {
        result = realType;
      }
    } else {
      if (['any', 'boolean', 'string', 'number', 'object', 'function', 'array', 'html', 'javascript', 'css', 'errorParam', 'json', 'text', 'date'].indexOf(realType) === -1 && realType !== '_Component' && realType !== '_ClassInfo') {
        if (isArray) {
          result = '[' + realType + ']';
        } else {
          result = realType;
        }
      } else {
        if (isArray) {
          result = '[' + realType + ']';
        } else {
          result = realType;
        }
      }
    }
    return result;
  }

  function _getModelId(name) {
    var result = '',
      id = '';

    for (id in that.require('factory').system().models()) {
      if (that.require('factory').system().models()[id]._name === name) {
        result = id;
        break;
      }
    }
    return result;
  }

  function _isType(name) {
    return typeof types[name] !== 'undefined';
  }

  function _clean(text) {
    return text.replace(/\{/g, '').replace(/\}/g, '');
  }

  function _cleanName(text) {
    return text.replace(/\./g, '').replace(/\-/g, '');
  }

  function _cleanVal(text) {
    var clean = JSON.stringify(text).replace(/\"/g, '\'')
      .replace(/\./g, '\\.')
      .replace(/\-/g, '\\-')
      .replace(/\{/g, '\\{')
      .replace(/\}/g, '\\}')
      .replace(/\</g, '\\<')
      .replace(/\>/g, '\\>')
      .replace(/\\n/g, '');

    if (clean.length > 30) {
      return clean.substring(0, 30) + '...';
    } else {
      return clean;
    }
  }

  // COMPUTATION

  switch (diagramType) {
    case 'graph':

      // create node
      for (modelId in models) {

        modelName = models[modelId]._name;
        parents = this.require('factory').getParents(modelName);
        if (modelName !== 'Nodes' && modelName !== 'Relationships' && parents.indexOf('Nodes') !== -1) {
          modelNames.push(modelName);
          modelDescription += '\n\n\t' + modelName + ' [\n\t\tlabel = ' + modelName + ']';
        }
      }

      // create relationships
      for (modelId in models) {

        modelName = models[modelId]._name;
        parents = this.require('factory').getParents(modelName);
        modelDef = this.require('factory').getGeneratedModel(modelName);
        if (modelName !== 'Nodes' && modelName !== 'Relationships' && parents.indexOf('Relationships') !== -1) {
          incoming = modelDef.incoming.type;
          outgoing = modelDef.outgoing.type;

          edges += `\n\tedge [
            arrowhead = "normal"
            headlabel = ""
            taillabel = ""
            fontsize = 5
            label     = ${modelName}
            style     = "normal"
          ]`;

          switch (true) {
            case incoming === 'Nodes' && outgoing === 'Nodes':
              modelNames.forEach(function (incoming) {
                modelNames.forEach(function (outgoing) {
                 edges += '\n\t' + _cleanName(incoming) + ' -> ' + _cleanName(outgoing);
                });
              });
              break;
            case incoming === 'Nodes' && outgoing !== 'Nodes':
              modelNames.forEach(function (incoming) {
                edges += '\n\t' + _cleanName(incoming) + ' -> ' + _cleanName(outgoing);
              });
              break;
            case incoming !== 'Nodes' && outgoing !== 'Nodes':
                edges += '\n\t' + _cleanName(incoming) + ' -> ' + _cleanName(outgoing);
              break;
            default:
              break;
          }
        }
      }

      break;

    case 'component':

      // create instances
      for (modelName in components) {
        for (componentId in components[modelName]) {
          instances += '\n\n\t' + _cleanName(componentId) + ' [\n\t\tlabel = "{\n\t\t\t' + componentId + ' : ' + modelName + '|';
          attributes = '';

          for (var prop in components[modelName][componentId]) {
            if (prop !== '_id') {
              attributes += '\n\t\t\t' + prop + ' = ' + _cleanVal(components[modelName][componentId][prop]) + '\\l';
            }
          }

          instances += attributes;
          instances += '\n\t\t}"\r\t]';

          //instancesOf += '\n\t' + _cleanName(componentId) + ' -> ' + modelName;
        }
      }
      break;

    case 'class':

      // create model for types
      for (typeId in types) {

        // structure
        if (types[typeId].schema) {
          typeName = types[typeId].name;
          modelDescription += '\n\n\t' + typeName + ' [\n\t\tlabel = "{\n\t\t\t' + typeName + '|';

          attributes = '';
          keys = [];
          sortedKeys = {};

          // get keys
          for (propName in types[typeId].schema) {
            keys.push(propName);
          }
          keys.sort();

          // sorted keys
          keys.forEach(function (key) {
            sortedKeys[key] = types[typeId].schema[key];
          }.bind(this));

          for (propName in sortedKeys) {
            if (types[typeId].schema.hasOwnProperty(propName)) {
              propDef = types[typeId].schema[propName];
              attributes += '\n\t\t\t+ ' + propName + ' : ' + propDef.type + '\\l';
              if (_isType(propDef.type)) {
                dependencies += '\n\t' + typeName + ' -> ' + propDef.type;
              }
            }
          }

          modelDescription += _clean(attributes);
          modelDescription += '\n\t\t}"\r\t]';
        }

        // enumeration
        if (types[typeId].value) {
          typeName = types[typeId].name;
          modelDescription += '\n\n\t' + typeName + ' [\n\t\tlabel = "{\n\t\t\t\\<\\<enumeration\\>\\>\\l' + typeName + '|';

          attributes = '';

          types[typeId].value.forEach(function (enumValue) {
            attributes += '\n\t\t\t' + enumValue + '\\l';
          });

          modelDescription += _clean(attributes);
          modelDescription += '\n\t\t}"\r\t]';
        }
      }

      // create model
      for (modelId in models) {

        modelName = models[modelId]._name;
        modelDescription += '\n\n\t' + modelName + ' [\n\t\tlabel = "{\n\t\t\t' + modelName + '|';

        attributes = '';
        methods = '';
        keys = [];
        sortedKeys = {};

        // get keys
        for (propName in models[modelId]) {
          keys.push(propName);
        }
        keys.sort();

        // sorted keys
        keys.forEach(function (key) {
          sortedKeys[key] = models[modelId][key];
        }.bind(this));

        for (propName in sortedKeys) {
          if (models[modelId].hasOwnProperty(propName)) {
            propVal = models[modelId][propName];

            switch (true) {
              case typeof propVal.type !== 'undefined':
                if (!Array.isArray(propVal.type)) {
                  if (that.require('factory').isModel(propVal.type)) {
                    if (modelId !== '123751cb591de26' && propVal.type !== '_Component') {
                      attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type + '\\l';
                      links += '\n\t' + modelName + ' -> ' + propVal.type;
                    } else {
                      attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type + '\\l';
                      links += '\n\t' + modelName + ' -> ' + propVal.type;
                    }
                  } else {
                    if (['any', 'boolean', 'string', 'number', 'object', 'function', 'array', 'html', 'javascript', 'css', 'json', 'text', 'date'].indexOf(propVal.type) === -1) {
                      if (modelId !== '123751cb591de26') {
                        attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type + '\\l';
                        dependencies += '\n\t' + modelName + ' -> ' + propVal.type;
                      } else {
                        attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type + '\\l';
                        //links += '\n\t' + modelName + ' -> ' + propVal.type;
                      }
                    } else {
                      attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type + '\\l';
                    }
                  }
                } else {
                  if (that.require('factory').isModel(propVal.type[0])) {
                    if (modelId !== '123751cb591de26' && propVal.type[0] !== '_Component') {
                      attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type[0] + ' [ ]\\l';
                      collections += '\n\t' + modelName + ' -> ' + propVal.type[0];
                    } else {
                      attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type[0] + ' [ ]\\l';
                      collections += '\n\t' + modelName + ' -> ' + propVal.type[0];
                    }
                  } else {
                    if (['any', 'boolean', 'string', 'number', 'object', 'function', 'array', 'html', 'javascript', 'css', 'json', 'text', 'date'].indexOf(propVal.type[0]) === -1) {
                      if (modelId !== '123751cb591de26') {
                        attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type[0] + ' [ ]\\l';
                        //collections += '\n\t' + modelName + ' -> ' + propVal.type[0];
                        dependencies += '\n\t' + modelName + ' -> ' + propVal.type[0];
                      } else {
                        attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type[0] + ' [ ]\\l';
                        collections += '\n\t' + modelName + ' -> ' + propVal.type[0];
                      }
                    } else {
                      attributes += '\n\t\t\t+ ' + propName + ' : ' + propVal.type[0] + ' [ ]\\l';
                      //collections += '\n\t' + modelName + ' -> ' + propVal.type[0];
                      // do not show types as links
                    }
                  }
                }
                break;

              case typeof propVal.params !== 'undefined':
                result = 'undefined';
                var params = '(';
                propVal.params.forEach(callbackProp.bind(this));
                params = params + ')';
                params = params.replace(', )', ')');

                if (typeof propVal.result !== 'undefined') {
                  result = _getReturnType(propVal.result);
                  if (modelId !== '123751cb591de26') {
                    methods += '\n\t\t\t+ ' + propName + params + ' : ' + result + '\\l';
                  } else {
                    methods += '\n\t\t\t+ ' + propName + params + ' : ' + result + '\\l';
                  }
                } else {
                  if (modelId !== '123751cb591de26') {
                    methods += '\n\t\t\t+ ' + propName + params + '\\l';
                  } else {
                    methods += '\n\t\t\t+ ' + propName + params + '\\l';
                  }
                }
                break;

              case propName.indexOf('_') !== -1:
                // we do not show private / internal properties
                break;

              default:
                result = 'undefined';
                if (typeof propVal.result !== 'undefined') {
                  result = _getReturnType(propVal.result);

                  if (modelId !== '123751cb591de26') {
                    methods += '\n\t\t\t+ ' + propName + '() : ' + result + '\\l';
                  } else {
                    methods += '\n\t\t\t+ ' + propName + '() : ' + result + '\\l';
                  }
                } else {
                  if (modelId !== '123751cb591de26') {
                    methods += '\n\t\t\t+ ' + propName + '()\\l';
                  } else {
                    methods += '\n\t\t\t+ ' + propName + '()\\l';
                  }
                }
                break;
            }
          }
        }

        modelDescription += _clean(attributes) + '|' + _clean(methods);
        modelDescription += '\n\t\t}"\r\t]';
      }

      // create inheritance links
      for (var schema in schemas) {
        if (schemas[schema]._inherit && schemas[schema]._inherit.length) {
          schemas[schema]._inherit.forEach(function (parent) {
            inheritance += '\n\t' + schemas[schema]._name + ' -> ' + parent;
          });
        }
      }

      // case of Component
      if (inheritance.indexOf('_Component') !== -1) {
        modelDescription += `\n\n\t_Component [
      label = "{\n\t\t\t_Component|\n\t\t\t+ id : string\\l|\n\t\t\t+ classInfo() : _ClassInfo\\l\n\t\t\t+ destroy()\\l\n\t\t\t+ error(data : errorParam)\\l\n\t\t\t+ init(conf : object)\\l\n\t\t\t+ off(state : string, behaviorId : string)\\l\n\t\t\t+ on(state : string, action : function, useCoreAPI : boolean, isCore : boolean) : string\\l\n\t\t\t+ require(id : string) : _Component\\l\n\t\t}"
  ]`
      };
      break;

    default:
      break;
  }

  // DIAGRAM

  switch (diagramType) {
    case 'graph':
      generatedDiagram = `digraph system {
      fontname = "Bitstream Vera Sans"
      rankdir = LR;

      node [
        fontname = "Bitstream Vera Sans"
        fontsize = 10
        shape = "circle"
      ]
      ${modelDescription}

      ${edges}

    }`;
      break;

    case 'component':
      generatedDiagram = `digraph system {
      fontname = "Bitstream Vera Sans"
      fontsize = 10

      node [
        fontname = "Bitstream Vera Sans"
        fontsize = 10
        shape = "record"
      ]

      edge [
        fontname = "Bitstream Vera Sans"
        fontsize = 10
      ]${modelDescription}

      node [
        fontname = "Bitstream Vera Sans"
        fontsize = 10
      ]
      ${instances}

      edge [
        arrowhead = "vee"
        headlabel = ""
